import React, { useState } from 'react';

const SignUp = () => {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const getData = () => {
    console.warn(email, name, password);
  }

  return (
    <div className='register'>
      <h1>Register</h1>
      <input className='inputfield' type='text' placeholder='Enter name' value={name} onChange={(e) => setName(e.target.value)} />
      <input className='inputfield' type='email' placeholder='Enter email' value={email} onChange={(e) => setEmail(e.target.value)} />
      <input className='inputfield' type='password' placeholder='Enter password' value={password} onChange={(e) => setPassword(e.target.value)} />
      <button onClick={getData} type='button' className='btn'>Sign up</button>
    </div>
  );
}

export default SignUp;
